  LOREM = %w[Cum ergo natus esset Jesus in Bethlehem Juda in diebus Herodis regis, ecce magi ab oriente venerunt Jerosolymam, dicentes Ubi est qui natus est rex Judorum? vidimus enim stellam ejus in oriente, et venimus adorare eum. Audiens autem Herodes rex, turbatus est, et omnis Jerosolyma cum illo. Et congregans omnes principes sacerdotum, et scribas populi, sciscitabatur ab eis ubi Christus nasceretur. At illi dixerunt In Bethlehem Jud sic enim scriptum est per prophetam Tunc Herodes clam vocatis magis diligenter didicit ab eis tempus stell, qu apparuit eis et mittens illos in Bethlehem, dixit Ite, et interrogate diligenter de puero et cum inveneritis, renuntiate mihi, ut et ego veniens adorem eum. Qui cum audissent regem, abierunt, et ecce stella, quam viderant in oriente, antecedebat eos, usque dum veniens staret supra, ubi erat puer. Videntes autem stellam gavisi sunt gaudio magno valde. Et intrantes domum, invenerunt puerum cum Maria matre ejus, et procidentes adoraverunt eum et apertis thesauris suis obtulerunt ei munera, aurum, thus, et myrrham. Et responso accepto in somnis ne redirent ad Herodem, per aliam viam reversi sunt in regionem suam. Qui cum recessissent, ecce angelus Domini apparuit in somnis Joseph, dicens Surge, et accipe puerum, et matrem ejus, et fuge in gyptum, et esto ibi usque dum dicam tibi. Futurum est enim ut Herodes qurat puerum ad perdendum eum. Qui consurgens accepit puerum et matrem ejus nocte, et secessit in gyptum et erat ibi usque ad obitum Herodis ut adimpleretur quod dictum est a Domino per prophetam dicentem Ex gypto vocavi filium meum. Tunc Herodes videns quoniam illusus esset a magis, iratus est valde, et mittens occidit omnes pueros, qui erant in Bethlehem, et in omnibus finibus ejus, a bimatu et infra secundum tempus, quod exquisierat a magis. Tunc adimpletum est quod dictum est per Jeremiam prophetam dicentem dicens Surge, et accipe puerum, et matrem ejus, et vade in terram Isral defuncti sunt enim qui qurebant animam pueri. Qui consurgens, accepit puerum, et matrem ejus, et venit in terram Isral. Audiens autem quod Archelaus regnaret in Juda pro Herode patre suo, timuit illo ire et admonitus in somnis, secessit in partes Galil. Et veniens habitavit in civitate qu vocatur Nazareth ut adimpleretur quod dictum est per prophetas Quoniam Nazarus vocabitur. In diebus autem illis venit Joannes Baptista prdicans in deserto Jud, et dicens Pnitentiam agite appropinquavit enim regnum clorum. Hic est enim, qui dictus est per Isaiam prophetam dicentem Vox clamantis in deserto Parate viam Domini; rectas facite semitas ejus. Ipse autem Joannes habebat vestimentum de pilis camelorum, et zonam pelliceam circa lumbos suos esca autem ejus erat locust, et mel silvestre. Tunc exibat ad eum Jerosolyma, et omnis Juda, et omnis regio circa Jordanem; et baptizabantur ab eo in Jordane, confitentes peccata sua. Videns autem multos pharisorum, et sadducorum, venientes ad baptismum suum, dixit eis Progenies viperarum, quis demonstravit vobis fugere a ventura ira? Facite ergo fructum dignum pnitenti. Et ne velitis dicere intra vos Patrem habemus Abraham. Dico enim vobis quoniam potens est Deus de lapidibus istis suscitare filios Abrah. Jam enim securis ad radicem arborum posita est. Omnis ergo arbor, qu non facit fructum bonum, excidetur, et in ignem mittetur. Ego quidem baptizo vos in aqua in pnitentiam qui autem post me venturus est, fortior me est, cujus non sum dignus calceamenta portare ipse vos baptizabit in Spiritu Sancto, et igni. Cujus ventilabrum in manu sua et permundabit aream suam et congregabit triticum suum in horreum, paleas autem comburet igni inextinguibili. Tunc venit Jesus a Galila in Jordanem ad Joannem, ut baptizaretur ab eo. Joannes autem prohibebat eum, dicens Ego a te debeo baptizari, et tu venis ad me? Respondens autem Jesus, dixit ei Sine modo sic enim decet nos implere omnem justitiam. Tunc dimisit eum. Baptizatus autem Jesus, confestim ascendit de aqua, et ecce aperti sunt ei cli et vidit Spiritum Dei descendentem sicut columbam, et venientem super se. Et ecce vox de clis dicens Hic est Filius meus dilectus, in quo mihi complacui. Tunc Jesus ductus est in desertum a Spiritu, ut tentaretur a diabolo. Et cum jejunasset quadraginta diebus, et quadraginta noctibus, postea esuriit. Et accedens tentator dixit ei Si Filius Dei es, dic ut lapides isti panes fiant. Qui respondens dixit Scriptum est Non in solo pane vivit homo, sed in omni verbo, quod procedit de ore Dei. Tunc assumpsit eum diabolus in sanctam civitatem, et statuit eum super pinnaculum templi, et dixit ei Si Filius Dei es, mitte te deorsum. Scriptum est enim Quia angelis suis mandavit de te, et in manibus tollent te, ne forte offendas ad lapidem pedem tuum. Ait illi Jesus Rursum scriptum est Non tentabis Dominum Deum tuum. Iterum assumpsit eum diabolus in montem excelsum valde et ostendit ei omnia regna mundi, et gloriam eorum, et dixit ei Hc omnia tibi dabo, si cadens adoraveris me. Tunc dicit ei Jesus Vade Satana Scriptum est enim Dominum Deum tuum adorabis, et illi soli servies. Tunc reliquit eum diabolus et ecce angeli accesserunt, et ministrabant ei. Cum autem audisset Jesus quod Joannes traditus esset, secessit in Galilam et, relicta civitate Nazareth, venit, et habitavit in Capharnaum maritima, in finibus Zabulon et Nephthalim ut adimpleretur quod dictum est per Isaiam prophetam Terra Zabulon, et terra Nephthalim, via maris trans Jordanem, alila gentium populus, qui sedebat in tenebris, vidit lucem magnam et sedentibus in regione umbr mortis, lux orta est eis. Exinde cpit Jesus prdicare, et dicere Pnitentiam agite appropinquavit enim regnum clorum. Ambulans autem Jesus juxta mare Galil, vidit duos fratres, Simonem, qui vocatur Petrus, et Andream fratrem ejus, mittentes rete in mare (erant enim piscatores), Et ait illis Venite post me, et faciam vos fieri piscatores hominum. At illi continuo relictis retibus secuti sunt eum. Et procedens inde, vidit alios duos fratres, Jacobum Zebedi, et Joannem fratrem ejus, in navi cum Zebedo patre eorum, reficientes retia sua et vocavit eos. Illi autem statim relictis retibus et patre, secuti sunt eum. Et circuibat Jesus totam Galilam, docens in synagogis eorum, et prdicans Evangelium regni et sanans omnem languorem, et omnem infirmitatem in populo. Et abiit opinio ejus in totam Syriam, et obtulerunt ei omnes male habentes, variis languoribus, et tormentis comprehensos, et qui dmonia habebant, et lunaticos, et paralyticos, et curavit eos et secut sunt eum turb mult de Galila, et Decapoli, et de Jerosolymis, et de Juda, et de trans Jordanem. Videns autem Jesus turbas, ascendit in montem, et cum sedisset, accesserunt ad eum discipuli ejus, et aperiens os suum docebat eos dicens Beati pauperes spiritu quoniam ipsorum est regnum clorum. Beati mites quoniam ipsi possidebunt terram. Beati qui lugent quoniam ipsi consolabuntur. Beati qui esuriunt et sitiunt justitiam quoniam ipsi saturabuntur. Beati misericordes quoniam ipsi misericordiam consequentur. Beati mundo corde quoniam ipsi Deum videbunt. Beati pacifici quoniam filii Dei vocabuntur. Beati qui persecutionem patiuntur propter justitiam quoniam ipsorum est regnum clorum. Beati estis cum maledixerint vobis, et persecuti vos fuerint, et dixerint omne malum adversum vos mentientes, propter me gaudete, et exsultate, quoniam merces vestra copiosa est in clis. Sic enim persecuti sunt prophetas, qui fuerunt ante vos. Vos estis sal terr. Quod si sal evanuerit, in quo salietur? ad nihilum valet ultra, nisi ut mittatur foras, et conculcetur ab hominibus. Vos estis lux mundi. Non potest civitas abscondi supra montem posita, neque accendunt lucernam, et ponunt eam sub modio, sed super candelabrum, ut luceat omnibus qui in domo sunt. Sic luceat lux vestra coram hominibus ut videant opera vestra bona, et glorificent Patrem vestrum, qui in clis est. Nolite putare quoniam veni solvere legem aut prophetas non veni solvere, sed adimplere. Amen quippe dico vobis, donec transeat clum et terra, jota unum aut unus apex non prteribit a lege, donec omnia fiant. Qui ergo solverit unum de mandatis istis minimis, et docuerit sic homines, minimus vocabitur in regno clorum qui autem fecerit et docuerit, hic magnus vocabitur in regno clorum. Dico enim vobis, quia nisi abundaverit justitia vestra plus quam scribarum et pharisorum, non intrabitis in regnum clorum. Audistis quia dictum est antiquis Non occides qui autem occiderit, reus erit judicio. Ego autem dico vobis quia omnis qui irascitur fratri suo, reus erit judicio. Qui autem dixerit fratri suo, raca reus erit concilio. Qui autem dixerit, fatue reus erit gehenn ignis. Si ergo offers munus tuum ad altare, et ibi recordatus fueris quia frater tuus habet aliquid adversum te relinque ibi munus tuum ante altare, et vade prius reconciliari fratri tuo et tunc veniens offeres munus tuum. Esto consentiens adversario tuo cito dum es in via cum eo ne forte tradat te adversarius judici, et judex tradat te ministro et in carcerem mittaris. Amen dico tibi, non exies inde, donec reddas novissimum quadrantem. Audistis quia dictum est antiquis Non mchaberis. Ego autem dico vobis quia omnis qui viderit mulierem ad concupiscendum eam, jam mchatus est eam in corde suo. Quod si oculus tuus dexter scandalizat te, erue eum, et projice abs te expedit enim tibi ut pereat unum membrorum tuorum, quam totum corpus tuum mittatur in gehennam. Et si dextra manus tua scandalizat te, abscide eam, et projice abs te expedit enim tibi ut pereat unum membrorum tuorum, quam totum corpus tuum eat in gehennam. Dictum est autem Quicumque dimiserit uxorem suam, det ei libellum repudii. Ego autem dico vobis quia omnis qui dimiserit uxorem suam, excepta fornicationis causa, facit eam mchari et qui dimissam duxerit, adulterat. Iterum audistis quia dictum est antiquis Non perjurabis reddes autem Domino juramenta tua. Ego autem dico vobis, non jurare omnino, neque per clum, quia thronus Dei est neque per terram, quia scabellum est pedum ejus neque per Jerosolymam, quia civitas est magni regis neque per caput tuum juraveris, quia non potes unum capillum album facere, aut nigrum. Sit autem sermo vester, est, est non, non quod autem his abundantius est, a malo est. Audistis quia dictum est Oculum pro oculo, et dentem pro dente. Ego autem dico vobis, non resistere malo sed si quis te percusserit in dexteram maxillam tuam, prbe illi et alteram et ei, qui vult tecum judicio contendere, et tunicam tuam tollere, dimitte ei et pallium et quicumque te angariaverit mille passus, vade cum illo et alia duo. Qui petit a te, da ei et volenti mutuari a te, ne avertaris. Audistis quia dictum est Diliges proximum tuum, et odio habebis inimicum tuum. Ego autem dico vobis diligite inimicos vestros, benefacite his qui oderunt vos, et orate pro persequentibus et calumniantibus vos ut sitis filii Patris vestri, qui in clis est qui solem suum oriri facit super bonos et malos et pluit super justos et injustos. Si enim diligitis eos qui vos diligunt, quam mercedem habebitis? nonne et publicani hoc faciunt? Et si salutaveritis fratres vestros tantum, quid amplius facitis? nonne et ethnici hoc faciunt? Estote ergo vos perfecti, sicut et Pater vester clestis perfectus est. Attendite ne justitiam vestram faciatis coram hominibus, ut videamini ab eis alioquin mercedem non habebitis apud Patrem vestrum qui in clis est. Cum ergo facis eleemosynam, noli tuba canere ante te, sicut hypocrit faciunt in synagogis, et in vicis, ut honorificentur ab hominibus. Amen dico vobis, receperunt mercedem suam. Te autem faciente eleemosynam, nesciat sinistra tua quid faciat dextera tua ut sit eleemosyna tua in abscondito, et Pater tuus, qui videt in abscondito, reddet tibi. Et cum oratis, non eritis sicut hypocrit qui amant in synagogis et in angulis platearum stantes orare, ut videantur ab hominibus amen dico vobis, receperunt mercedem suam. Tu autem cum oraveris, intra in cubiculum tuum, et clauso ostio, ora Patrem tuum in abscondito et Pater